# Functions

# image resizer


def Image_resizer(url1, url2):
    """
    Function to resize the image according to the size of the image of the first URL(url1)
    >>>>> url1 - url of the image which the width,height will be captured
    >>>>> url2 - url of the image to be resized as the image of url1

    """
    req1 = urllib.request.urlopen(url1)
    arr1 = np.asarray(bytearray(req1.read()), dtype=np.uint8)
    img1 = cv2.imdecode(arr1, -1)
    height = img1.shape[0]
    width = img1.shape[1]

    req2 = urllib.request.urlopen(url2)
    arr2 = np.asarray(bytearray(req2.read()), dtype=np.uint8)
    img2 = cv2.imdecode(arr2, -1)

    dim = (width, height)
    resized_image = cv2.resize(img2, dim)
    # print(img1.shape)
    # print(resized_image.shape)
    return resized_image


def Dataframe(url):
    data = requests.get(url).content
    df = pd.read_csv(io.StringIO(data.decode('utf-8')))
    return df


def top_order(category, sub_category):
    st.title(f"Viewing Analysis of {category}")
    st.metric(label='Sub-category', value=sub_category)


def expander(fig_number, *content):
    with st.expander(f"Figure{fig_number}: Interpretation"):
        for description in content:
            st.markdown("**"+description+"**")


